import './massage.css'

export const Massage=()=>{
    return(
<div className='flex'>
   <div className=""> <MassageMenu/></div>
   <div className=""> <MassageArea/></div>
</div>
    )
}



const MassageMenu=()=>{
    return(
<div className=''>

           <div className="">
               <MassageItem time='18;22' massage='ya'name='Dasha' />
               <MassageItem time='22:22' massage='heq'name='Katya'/>
               <MassageItem time='13:37' massage='sss'name='Tas'/>
           </div>
           </div>
    )
}



const MassageItem=(props)=>{
    return(

<div className='MassageFriend'>

           <a  className='FriendAvatar' href="#"> <img src="" alt="" /> </a>
           <div>
               <div className='NameTimeWrapper'>
           <span className='FriendName'>{props.name}</span>
           <span className='Time'>{props.time}</span>
           <div className='FriendMassage'>{props.massage}</div>
           </div>

           </div>

   </div>
    )
}

const MassageArea=(props)=>{
    return(

<div className='MassageArea'>
    <form method='get'>
        <textarea></textarea>
    </form>
   </div>
    )
}
